import React from 'react'; // Library react-JS
import {View,Text} from 'react-native'; // Library raect-JS

const App2 = () => {
  return(
      <View styles={{
          flex: 1,
          justifyContent: 'center',
          alignItems: 'center',
      }}>
          <Text>I LOVE IU</Text>
      </View>
  )

}

function App(){
    return(
      <View style={{
        flex:1,
        justifyContent:'center',
        alignItems:'center',

      }}>
      <Text>IU</Text>
      </View>
    )
}
export default App;
